const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d"); // Creates a CanvasRenderingContext2D object representing a two-dimensional rendering context.

const image1 = new Image(); // creates new bitmap image instance (same as img in html)
image1.src =
  "data:image/jpeg;base64,";

image1.onload = function initialize() {
  canvas.width = image1.width;
  canvas.height = image1.height;
  ctx.drawImage(image1, 0, 0); // image,dx,dy
};

class AsciiEffect {
  // by default class fields are public
  // pvt class members are created using # prefix
  // pvt encapsulation of class features will be enfoced by js
  // js will throw error if used outside

  #imageCellArray = [];
  #symbols = []; // symbols to replace pixels
  #pixels = []; // holds pixel data returned by getPixelData method
  #ctx; // canvas reference
  #width;
  #height;

  constructor(ctx, width, height) {
    // when calling constructor, pass 'canvas' to draw on, it's width & height
    this.#ctx = ctx;
    this.#width = width;
    this.#height = height;
    this.#imageCellArray = new Array(this.#width * this.#height);
    this.#pixels = this.getPixelData();
  }
}
